import React from 'react'

import './CharacterCard.css'
import { AiOutlineHeart } from 'react-icons/ai';
import { AiFillHeart } from 'react-icons/ai';


export const CharacterCard = ({Img, Name, Gender, Height, Mass, favorite}) => {
  return (
    <div class="card g-col-12 g-col-sm-6 g-col-lg-3">
      <img src={Img} class="card-img-top" />
      
      <div class="card-body">
        <h5 class="card-title">{Name}</h5>
        
        <div class="card-text">
          <p><b>Gender:</b> {Gender}</p>
          <p><b>Height:</b> {Height} cm.</p>
          <p><b>Mass:</b> {Mass} kg.</p>
        </div>
        
        <div className='container-Buttons'>
          <a href="#" class="btn btn-dark">View more!</a>
          {favorite?<AiFillHeart className='iconCard' />:<AiOutlineHeart className='iconCard' />}
        </div>
        
      </div>
    </div>
  )
}
